import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container mx-auto bg-gray-200 rounded-xl shadow-lg border p-8 m-10 hover:bg-blue-400">
      <p className="text-gray-700 font-bold mb-5 text-5xl">
        Welcome!
      </p>
      <p className="text-gray-500 text-lg text-start">
        React and Tailwind CSS in action
      </p>

      <button className=" text-white bg-blue-400 p-2 rounded-xl align-middle">Please Click Me</button>
    </div>
  );
}
export default App;
